Today the world bestowed upon us two women that I am eternally grateful for and so I created a Reel dump with lotsa looks, lotsa moments , and lotsa love. 
@sallypr81 my compass was wonky until I met you my true north bestie. 
@stacey_browne my method was seen clearly only in me until I met you! (And @mariakelling 😉)

I love you birthday girls dearly and may we move together through life and in class forever and always! 
Please help me wish @sallypr81 and @stacey_browne the Happiest of Birthdays! ♥️🎉♥️🎉🎂🎂🎂
